import React from "react";
import AppBarHeader from "./AppBar/AppBarHeader";
import MainHeader from "./MainHeader";
import Drawer from "./AppBar/Drawer";
const Home = () => {
    return (
        <React.Fragment>
            <AppBarHeader />
            <Drawer></Drawer>
            <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
                <DrawerHeader />
            </Box>
        </React.Fragment>

    );
};
export default Home;
